import React from "react";
import "./App.css";
import Sidebar from "./Sidebar";
import Chat from "./Chat";

function App() {
  return (
    <div className="app">
      <div className="app__body">
        <Router>
          <Switch>
            <Route path="/app">
              <Sidebar />
              <Chat />
            </Route>
            <Route path="/">
              <h1>Home screen</h1>
            </Route>
          </Switch>
        </Router>

        {/* // Sidebar
          // chat */}
      </div>
    </div>
  );
}

export default App;
